import React from 'react'
import styled from 'styled-components';
import Methane from '../svg/Methane';
import Moist from '../svg/Moist';
import Temperature from '../svg/Temperature';

const Circle = styled.div`
  height: 50px;
  width: 50px;
  border-radius: 50%;
  border-color: #324BB8;
  border-style: solid;
  border-width: 2px;
`;

class Measurement extends React.Component {
  render() {
    const name = this.props.name;

     if (name === "methane") {
       return <Circle> <Methane width="35" height="35" /> </Circle>;
     } else if (name === "moist") {
       return <Circle> <Moist width="35" height="35" /> </Circle>;
     } else if (name === "temperature") {
      return <Circle> <Temperature width="35" height="35" /> </Circle>;
    }

    return <div></div>;

  }
}

export default Measurement;
